import Popup from "./components/Popup";
import Badge from "./components/Badge";

function OrderDetail({data, onClose}){
  const { monolithOrderId, orderDate, carName, carImage} = data;
  console.log('data: ', data);
  return(
    <Popup title={'Car E-Voucher'} handleClose={onClose}>
      <div className="flex flex-col text-base">
        <div className="flex flex-col sm: flex-row sm: min-w-max">
          <span className="text-blue-800 font-semibold">Order ID #{monolithOrderId}</span>
          <Badge text={`Tanggal Pesan : ${orderDate}`} background={'bg-blue-200'} color={'text-blue-700'}/>
        </div>
        <div className="my-4 flex flex-col justify-center">
          <div>
            <span>{carName}</span>
            <img className="h-20 w-fit" src={carImage} alt="car"/>
          </div>
        </div>
      </div>
    </Popup>
  )
}

export default OrderDetail;
